function Card(props) {
  function handleClick() {
    props.onCardClick({ name: props.card.name, link: props.card.link });
  }

  return (
    <div class="card">
      <img
        src={props.card.link}
        alt={`картинка ${props.card.name}`}
        class="card__image"
        onClick={handleClick}
      />
      <button class="card__image-button hover"></button>
      <div class="card__description">
        <h2 class="card__description-title">{props.card.name}</h2>
        <div class="card__like-container">
          <button class="card__like-button hover" type="button"></button>
          <p class="card__like">{props.card.likes.length}</p>
        </div>
      </div>
    </div>
  );
}

export default Card;
